import React, { Component } from 'react';


function clock(props){
  return (<div>
    <canvas id="canvas" width="500" height="500"></canvas>
    <div class="controler">
        <button id="start" type="submit">Start</button>
        <button id="reset">Reset</button>
    </div>
    </div>
  )
}

export default clock;
